Information
------------------------------

London's Zeppelin Attacks
The German zeppelins bombed thousands of British homes during World War I in a ruthless bid to break the nation's morale, but what were the deadly balloons made from? And why did it take military engineers so long to find a way to stop them?
This documentary explores how the Germans turned narrow tubes of cow intestine into enormous weapons of war and what made these great balloons of gas so indestructible. It also examines how, eventually, British scientists and engineers developed a special flaming bullet that would put an end to the gigantic airships' reign of terror.

